import React, { Component } from 'react';

const Number = [
  1,
  2,
  3,
  4,
  5,
  6,
  7,
  8,
  9,
  0,
  '+',
  '-',
  '*',
  '/',
  '%',
  '.',
  '=',
];

class Calculator extends Component {
  render() {
    console.log(Number);
    return (
      <div>
        <input />
        <div>
          {Number.map((x) => {
            return <button>{x}</button>;
          })}
        </div>
      </div>
    );
  }
}

export default Calculator;
